Son univers musical est marqué par des textes profonds, souvent personnels, mêlant réalité sociale, introspection et attitude rebelle, avec une direction artistique résolument street et authentique. REBL ne suit pas les tendances : il les défie.

Au-delà de la musique, il incarne une nouvelle génération d’artistes-entrepreneurs. Il est le fondateur et gérant de STASHWEAR, une marque de streetwear innovante conçue et fabriquée à Madagascar. Avec ses designs techniques, ses poches secrètes et une identité visuelle forte, STASHWEAR reflète l’ADN de REBL : indépendance, style et résilience.

Entre studio et stratégie, micro et design, REBL construit son propre empire, à l’image de sa musique : sans filtre, enraciné dans le réel et tourné vers l’avenir.', '', 'https://res.cloudinary.com/dzqqbqsiw/image/upload/v1751370358/p1ykuselhkvbmlihygnf.jpg', '2025-05-22T07:39:50.013326+00:00', '2025-06-13T13:56:37.265103+00:00', 'Njaratsiry', 'ANDRIATSARASON', 'madagascar', NULL, NULL, 'REBL', NULL, NULL, NULL, NULL, NULL, 'STASHMUSIC', hip_hop, rapper,singer,producer, [object Object], 'https://res.cloudinary.com/dzqqbqsiw/image/upload/v1751371402/yir4lwqfbr9sy8zwopoz.png', false, 16, 'rebl-1', 'active');

